('node', 'rlisting', 0, 5, 5, 'und', 0, 'Sits on a 33 x 122 lot with an RT-5 (duplex) zoning. A great property to hold or to build a new home. Quiet, treed &amp; convenient Mount Pleasant neighborhood. 2-car garage &amp; an enclosed deck.Newer roof, flooring, furnace, hot water tank, electrical panel, plumbing, windows, etc. Close to transit &amp; schools. Potential 2 bedroom suite in basement, and 1 bedroom suite in the attic. Building permit for a duplex pending issue in January. Owner spent about $15,000 on duplex design &amp; application. Floor plan may be provided with purchase\r\n', '', 'filter'),
