 '', 'filter'),
('node', 'rlisting', 0, 8, 8, 'und', 0, 'If you are looking for the best value for money in a QUALITY 2 bed+den/2 bath T/H (w/your own priv entrance) in a prime False Creek loc, this is it! Only 4 yrs old &amp; immaculate, hardly used condition. Many sought after features: Stunning gourmet kitchen boasting polished granite countertops, walnut shaker wood cabinets &amp; over $20,000 worth of Viking Professional Series S/S appliances w/gas range. Brazilian cherry H/W floors + gas F/P in LR/DR. Large mbdrm w/enste &amp; priv patio. Inste lndry + strge. Steps to False Creek seawall, Granville Island, Canada Line &amp; popular Cambie &amp; W Broadway shopping areas. Tremendous quality, value &amp; loc. Fantastic Westside Neighbourhood. 2 Pets okay any size and under the rental limit', '', 'filter'),
('node', 'rlisting', 0, 10, 10, 'und', 0, 'surrounded by beautiful parks &amp; seawall. This large 670 sf one-bedroom &amp; den has everything you&#39;ll need to enjoy a sophisticated lifestyle. Designer light fixtures, hardwood floors, Subzero refrigerator, gas stove/convection oven, Miele dishwasher &amp; intelligent LG front loader washer &amp; dryer. Designer EGGERSMAN cabinets throughout. Plus CLUB MILLENNIUM has an amazing Fitness Centre.', '', 'filter'),
('node', 'rlisting', 0, 11, 11, 'und', 0, 'Prestigious north of 4th location near shops, restaurants &amp; transit. Spacious &amp; private w/ gorgeous garden &amp; a short walk to beach, tennis &amp; Kits pool. Totally updated including gorgeous modern kitchen&amp; baths w/ contemporary styling &amp; new quartz counters, hand-made tiles, lighting, hardwood, fireplace surround, &amp; millwork. New air conditioning, hw tank, roof &amp; fence. Ideal for entertaining w/ sunken LR. Kitchen-family area opens to dining &amp; private south garden patio. Single garage &amp; parking pad. Three 2nd floor bedrooms &amp; open office, laundry &amp; full bath. Top flr is 460 sqft master suite w/luxury limestone/quartz enste bath, walk in closet w/custom millwork, &amp; private roof deck w/ mountain/water view.', '', 'filter'),
('node', 'rlisting', 0, 17, 17, 'und', 0, 'desirable concrete building. Highbury Tower in Point Grey has recently undergone rainscreen technology and carries the majority of the warranty. This spacious floor plan contains an oversize master bedroom and a large functional kitchen. Most of the suite has new Brazilian walnut floors to enhance the classy appeal. Enjoy the flexibility of two bathrooms, the only one bedroom suite that includes this feature. Be sure to take advantage of all year round BBQing under the covered balcony. Fantastic location, close to shopping, transit, UBC and a short walk to the beaches.', '', 'filter'),
('node', 'openhouse', 0, 21, 21, 'und', 0, 'come around the back. ', '', 'filter'),
('node', 'rlisting', 0, 24, 24, 'und', 0, 'All the bells & whistles including gourmet kitchen, Fisher & Paykel SS appl, light cabinets, open living room, large master with stunning ensuite, w/his/her closets and a balcony and solarium with incredible views of Yaletown, excellent for entertaining! Building also boasts a lovely rooftop garden for relaxing in the sun and enjoying the view. State of the art gym to keep you in shape, bike storage room, this unit has it all. ', '', 'filter'),
('node', 'openhouse', 0, 27, 27, 'und', 0, 'buzz #253', '', 'filter'),
('node', 'rlisting', 0, 32, 32, 'und', 0, ' This south-facing 1-BDRM + Flex, comes with a bright 96 SqFt covered deck, 9''+ high ceilings, radiant heat and cooling system, German-imported kitchen of Miele SS appliances, gas range-oven, dishwasher & fridge. Eggersman cabinetry & luxury fixtures throughout. Spa bathroom with stand-up seamless glass shower & soaker tub. Unit includes 1 parking & access to the rooftop garden & lounge - also to Gold Medal Club with its indoor pool, hot-tub, sauna/steam rooms and exercise facilities. Urban Fare, London Drugs (Aug 31), Legacy Liquor Store, Canada Line & Expo SkyTrain Stations, bus lines, Aquabus, seawall & more at your doorstep. Was owner-occupied, perfect condition.', '', 'filter'),
('node', 'openhouse', 0, 33, 33, 'und', 0, 'come around the back', '', 'filter'),
('node', 'openhouse', 0, 34, 34, 'und', 0, 'Come around the back.', '', 'filter'),
('node', 'openhouse', 0, 36, 36, 'und', 0, 'Come around the back and buzz', '', 'filter'),
('node', 'page', 0, 37, 37, 'und', 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Proin at magna justo. Curabitur ac lacus neque, a auctor ligula. Ut ligula metus, elementum eu pretium et, posuere lobortis leo. Quisque blandit nulla nec erat pellentesque viverra ac sed mauris. Nam ac velit magna, vitae laoreet sem. Aliquam sagittis elit eu ipsum aliquet quis imperdiet turpis tincidunt. Vestibulum augue felis, ultrices nec cursus id, rutrum et magna. Cras placerat, lectus egestas iaculis adipiscing, nunc est lacinia lorem, ut accumsan eros purus sed nisl. Suspendisse tempor arcu vitae augue ullamcorper id imperdiet lacus sollicitudin. Donec diam massa, accumsan ut facilisis ut, lobortis non turpis. Sed quis bibendum velit. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae;', '', 'filter');
